    const [user, setUser] = useState('');
    // const navigate = useNavigate();
    const getProfileData = async ()=>{
        axios.get("http://localhost:3001/users/me",{
        })
        .then(res => {
            console.log(res);
            setUser(res.data)
        })
        .catch((err) => {
            console.error(err);
        });

    };    
    useEffect(() => {
        getProfileData();
      }, []);
    return (
        <>
            <div className='container'>
                <div>
                    <p>Name: {user.name}</p>
                    <p>Email: {user.email}</p>
                </div>
            </div>
        </>
    )

}
export default Profile;
